select count(*) as aggregate from (select `bravo_spaces`.* from `bravo_spaces` inner join `bravo_space_term` as `tt` on `tt`.`target_id` = `bravo_spaces`.`id` where `bravo_spaces`.`status` = 'publish' and ( (IFNULL(bravo_spaces.sale_price,0) > 0 and bravo_spaces.sale_price >= '120' ) OR (IFNULL(bravo_spaces.sale_price,0) <= 0 and bravo_spaces.price >= '120' ) )
AND ( (IFNULL(bravo_spaces.sale_price,0) > 0 and bravo_spaces.sale_price <= '155250' ) OR (IFNULL(bravo_spaces.sale_price,0) <= 0 and bravo_spaces.price <= '155250' ) ) and `tt`.`term_id` in ('114') and ( '6371' * acos(
cos( radians('51.5077637') ) * cos( radians( map_lat ) ) * cos( radians( map_lng ) - radians('5.3978482') )
+ sin( radians('51.5077637') ) * sin( radians(map_lat) )
)
) <= '10' and `bravo_spaces`.`deleted_at` is null group by `bravo_spaces`.`id`) as `aggregate_table`
